import React from 'react';
import { Container, Typography, Box } from '@mui/material';

const About = () => {
  return (
    <Container maxWidth="md" sx={{ padding: '2rem 0' }}>
      <Box sx={{ textAlign: 'center', marginBottom: '2rem' }}>
        <Typography variant="h4" component="h1" gutterBottom>
          About Storify
        </Typography>
        <Typography variant="body1" color="textSecondary">
          Storify is a platform that allows you to upload, organize, and access your files from anywhere. 
          Our mission is to provide a seamless and secure file management experience for all users.
        </Typography>
      </Box>
    </Container>
  );
};

export default About;
